#[derive(Default, Builder, Debug, Clone)]
pub struct GameTurn {
  pub id: i64,
  pub name: String,
  pub password: String,
  pub creator: i64,
  pub start_date: String,
  pub end_date: Option<String>,
  pub activity_date: String,
  pub maps_id: i64,
  pub weather_type: String,
  pub weather_start: Option<String>,
  pub weather_code: String,
  pub win_condition: Option<String>,
  pub turn: i64,
  pub day: i64,
  pub active: bool,
  pub funds: i64,
  pub capture_win: i64,
  pub fog: bool,
  pub comment: Option<String>,
  // type
  pub game_type: String,
  pub boot_interval: i64,
  pub starting_funds: i64,
  pub official: bool,
  pub min_rating: i64,
  pub max_rating: Option<i64>,
  pub league: Option<String>,
  pub team: bool,
  pub aet_interval: i64,
  pub aet_date: Option<String>,
  pub use_powers: bool,
  pub players: Vec<Player>,
  pub buildings: Vec<Building>,
  pub units: Vec<Unit>,
  pub timers_initial: i64,
  pub timers_increment: i64,
  pub timers_max_turn: i64,
}

pub fn read_game_turn(input: &str) -> IResult<&str, GameTurn> {
  let (input, _) = tag(r#"O:8:"awbwGame":"#)(input)?;
  let (input, num_fields) = read_next_length(input)?;
  let (input, _) = tag("{")(input)?;
  let mut game_turn_builder = GameTurnBuilder::default();

  let mut input_loop = input;

  for _j in 0..num_fields {
    let input = input_loop;
    let (input, entry) = read_string(input)?;
    let input = match entry {
      "id" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.id(value);
        input
      }
      "name" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.name(value.to_owned());
        input
      }
      "password" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.password(value.to_owned());
        input
      }
      "creator" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.creator(value);
        input
      }
      "start_date" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.start_date(value.to_owned());
        input
      }
      "end_date" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.end_date(value.map(|v| v.to_owned()));
        input
      }
      "activity_date" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.activity_date(value.to_owned());
        input
      }
      "maps_id" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.maps_id(value);
        input
      }
      "weather_type" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.weather_type(value.to_owned());
        input
      }
      "weather_start" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.weather_start(value.map(|v| v.to_owned()));
        input
      }
      "weather_code" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.weather_code(value.to_owned());
        input
      }
      "win_condition" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.win_condition(value.map(|v| v.to_owned()));
        input
      }
      "turn" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.turn(value);
        input
      }
      "day" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.day(value);
        input
      }
      "active" => {
        let (input, value) = read_bool(input)?;
        game_turn_builder.active(value);
        input
      }
      "funds" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.funds(value);
        input
      }
      "capture_win" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.capture_win(value);
        input
      }
      "fog" => {
        let (input, value) = read_bool(input)?;
        game_turn_builder.fog(value);
        input
      }
      "comment" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.comment(value.map(|v| v.to_owned()));
        input
      }
      "type" => {
        let (input, value) = read_string(input)?;
        game_turn_builder.game_type(value.to_owned());
        input
      }
      "boot_interval" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.boot_interval(value);
        input
      }
      "starting_funds" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.starting_funds(value);
        input
      }
      "official" => {
        let (input, value) = read_bool(input)?;
        game_turn_builder.official(value);
        input
      }
      "min_rating" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.min_rating(value);
        input
      }
      "max_rating" => {
        let (input, value) = read_i64_opt(input)?;
        game_turn_builder.max_rating(value);
        input
      }
      "league" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.league(value.map(|v| v.to_owned()));
        input
      }
      "team" => {
        let (input, value) = read_bool(input)?;
        game_turn_builder.team(value);
        input
      }
      "aet_interval" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.aet_interval(value);
        input
      }
      "aet_date" => {
        let (input, value) = read_string_opt(input)?;
        game_turn_builder.aet_date(value.map(|v| v.to_owned()));
        input
      }
      "use_powers" => {
        let (input, value) = read_bool(input)?;
        game_turn_builder.use_powers(value);
        input
      }
      "players" => {
        let (input, value) = read_players(input)?;
        game_turn_builder.players(value);
        input
      }
      "buildings" => {
        let (input, value) = read_buildings(input)?;
        game_turn_builder.buildings(value);
        input
      }
      "units" => {
        let (input, value) = read_units(input)?;
        game_turn_builder.units(value);
        input
      }
      "timers_initial" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.timers_initial(value);
        input
      }
      "timers_increment" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.timers_increment(value);
        input
      }
      "timers_max_turn" => {
        let (input, value) = read_i64(input)?;
        game_turn_builder.timers_max_turn(value);
        input
      }
      unknown => panic!("Replay player data contained unknown entry: {unknown}"),
    };
    input_loop = input;
  }

  let input = input_loop;
  // Newline as it is end of turn data
  let (input, _) = tag("}\n")(input)?;

  Ok((input, game_turn_builder.build().unwrap()))
}

